import React from 'react';
import { View, Text, TouchableOpacity } from 'react-native';

import styles from './styles';

const BottomButton = ({
  onPress,
  text,
  containerReplace,
  buttonTouchReplace,
  buttonTextReplace,
  container,
  buttonTouch,
  buttonText,
}) => {
  return (
    <View style={containerReplace || [styles.container, container]}>
      <TouchableOpacity
        onPress={onPress}
        style={buttonTouchReplace || [styles.buttonTouch, buttonTouch]}
      >
        <Text style={buttonTextReplace || [styles.buttonText, buttonText]}>
          {text}
        </Text>
      </TouchableOpacity>
    </View>
  );
};

export default BottomButton;
